import { Link } from 'react-scroll';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <header className="bg-blue-600 text-white p-5 fixed w-full z-10">
        <div className="container mx-auto flex justify-between">
          <h1 className="text-xl">All India Artificial Intelligence Council</h1>
          <nav>
            <Link
              activeClass="active"
              to="intro-section"
              spy={true}
              smooth={true}
              duration={500}
              className="mr-4 cursor-pointer"
            >
              Intro
            </Link>
            <Link
              activeClass="active"
              to="vision-section"
              spy={true}
              smooth={true}
              duration={500}
              className="mr-4 cursor-pointer"
            >
              Vision
            </Link>
            {/*... Add more links for other sections */}
          </nav>
        </div>
      </header>

      <main className="pt-16 p-5">
        <motion.section id="intro-section">
          <h2 className="text-2xl mb-4">AI Council - Intro</h2>
          <p>...</p>
        </motion.section>

        <motion.section id="vision-section">
          <h2 className="text-2xl mb-4">Vision</h2>
          <p>...</p>
        </motion.section>

        {/*... Continue for other sections ...*/}

      </main>

      <footer className="bg-blue-600 text-white p-5">
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
